import React from 'react';
import { Picture } from '../profiles/styles/profiles';

export default function Loading({ src, ...restprops }) {
    return (
        <spinner>
            <LockBody />
            <Picture src={`/images/users/${src}.png`} />

        </spinner>
    )
}
